/**
 *
 * `tagFeed(g)` generates `[e, n]`, where `e` is an item generated by `g` and `n` is the next value passed to generate `e`.
 *
 * `tagFeed(g)` returns `[r, n]`, where `r` is the return value of `r` and `n` is the next value passed to end `g`.
 *
 * @param g the generator whose feed is to be tagged
 * @returns
 */
export declare function tagFeed<T, TReturn = any, TNext = T>(g: AsyncGenerator<T, TReturn, TNext>): AsyncGenerator<(T | TNext)[], (TReturn | TNext)[], TNext>;
export declare function tagFeed<T, TReturn = any, TNext = T>(g: Generator<T, TReturn, TNext>): Generator<(T | TNext)[], (TReturn | TNext)[], TNext>;
